import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { ContainerBase } from '../../style';
import { ContainerAction, ContainerPage } from './style';

export default function SecondPage() {
    const [inputStatus, setInputStatus] = useState('')
    const sendStatus = `https://http.cat/${inputStatus}`
    const navigate = useNavigate('')

    const nextPage = ()=>{navigate('/thirdPage')}

 return (
   <ContainerBase>
        <ContainerAction>
            <input
                placeholder='Digite um status code'
                value={inputStatus}
                onChange={(ev)=>{setInputStatus(ev.target.value)}}
            />
            <button onClick={nextPage}>Buscar</button>
            <button onClick={nextPage}>Avancar</button>
        </ContainerAction>
        <ContainerPage>
                <h2>status code</h2>
            <div>
                <input
                    placeholder='Digite um status code'
                    value={inputStatus}
                    onChange={(ev)=>{setInputStatus(ev.target.value)}}
                />
            </div>
            <section>
                <img src={sendStatus}/>
            </section>
        </ContainerPage>
   </ContainerBase>
 );
}
